export default function CreateProduct(){
    const [name, setName] = useState('');

    console.log(name);

    return(
        <form>
            <label htmlFor='name'>
                <input 
                    type='text' 
                    name='name' 
                    id='name' 
                    placeholder='Name' 
                    value={name} 
                    onChange={e => {console.log(e); setName(e.target.value)}}
                /> 
            </label>
        </form>
    )
}
